import React from 'react';
import { withStyles } from '@material-ui/core';
import AddIcon from '@material-ui/icons/Add';
import FavoriteIcon from '@material-ui/icons/Favorite';

const Poster = (props) => {
  const { classes } = props;

  console.log(props)

  return (
    <div className={classes.container}>
      <img
        alt={'coco'}
        src={'http://image.tmdb.org/t/p/w185//nBNZadXqJSdt05SHLqgT0HuC5Gm.jpg'}
      />
      <div className={classes.iconContainer}>
        <FavoriteIcon onClick={() => console.log('Ajout à la liste des films likés')} color="error" />
        <AddIcon onClick={() => console.log('Ajout à la liste des films à voir')} />
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    flex: 1,
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center'
  },
  iconContainer: {
    display: 'flex',
    flex: 1,
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center'
  }
}

export default withStyles(styles)(Poster);
